import React, { Component } from "react";
import axios from 'axios';

export class Dashboard extends Component {
  constructor() {
    super();
    this.state = {
      users: []
    };
  }

  componentDidMount(){
      axios.get('/api/users').then( response =>
          console.log(response.data)
      );
  }
  render() {

    return (
    <div>
        <h1>Clients</h1>
    </div>
    );
  }
}

export default Dashboard;
